import React from 'react';
import './App.css';

class Clock extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            time: ''
        }
    }

    render(){
        return(
            <div>
                {this.state.time}
            </div>
        );
    }
}

function App() {
  return (
    <div className="App">
      <Clock />
    </div>
  );
}

export default App;
